// Creamos un array con todas las Descripción válidas de Sheets
const descripcionList = items
  .map(item => {
    const desc = item.json.Descripción;
    if (!desc || desc === "[undefined]") return null;
    return desc.toString().trim().toLowerCase();
  })
  .filter(desc => desc); // eliminamos null/undefined

// Filtramos los registros de Odoo que NO existen en Sheets y que tengan x_name válido
const notInSheets = items
  .map(item => item.json)
  .filter(json => {
    const x_name = json.x_name;
    if (!x_name || x_name === "[undefined]") return false; // descartamos undefined
    return !descripcionList.includes(x_name.toString().trim().toLowerCase());
  })
  .map(json => {
    // Convertimos create_date a hora Argentina y mantenemos formato YYYY-MM-DD HH:mm:ss
    let create_date_arg = null;
    if (json.create_date) {
      const dateUTC = new Date(json.create_date + 'Z'); // UTC
      // Convertimos a hora Argentina usando toLocaleString
      const argDate = new Date(dateUTC.toLocaleString('en-US', { timeZone: 'America/Argentina/Buenos_Aires' }));
      const yyyy = argDate.getFullYear();
      const MM = String(argDate.getMonth() + 1).padStart(2, '0');
      const dd = String(argDate.getDate()).padStart(2, '0');
      const hh = String(argDate.getHours()).padStart(2, '0');
      const mm = String(argDate.getMinutes()).padStart(2, '0');
      const ss = String(argDate.getSeconds()).padStart(2, '0');
      create_date_arg = `${yyyy}-${MM}-${dd} ${hh}:${mm}:${ss}`;
    }

    return {
      json: {
        id: json.id,
        x_name: json.x_name,
        x_studio_log_estadoanterior: json.x_studio_log_estadoanterior,
        x_studio_log_estadonuevo: json.x_studio_log_estadonuevo,
        x_studio_log_tag: json.x_studio_log_tag,
        create_date: json.create_date,
        write_date: json.write_date,
        x_studio_log_fecha_y_hora: json.x_studio_log_fecha_y_hora,
        create_date_arg: create_date_arg,
        x_studio_log_categ_id: json.x_studio_log_categ_id
      }
    };
  });

return notInSheets;

